import ErrorIcon from "../Icones/error";
import { useNavigate } from "react-router-dom"
const ErrorPage=()=>{
    return (
        <>
            <ErrorIcon></ErrorIcon>
            <h1>404</h1>
            <p>Voce parece meio perdido</p>
            <a onClick={()=>navigate("/")}>Home</a>

        </>

    )
}
export default ErrorPage
